import React from "react";
import Style from "../style/mainContent.css";
function Timer() {
  const date = new Date();
  const hours = date.getTime();
  let dayOfTime;

  if (hours < 12) {
    dayOfTime = "Morning";
  } else if (hours >= 12 && hours < 17) {
    dayOfTime = "Afternoon";
  } else {
    dayOfTime = "Night";
  }

  return (
    <div>
      <p className="time">{dayOfTime}</p>
    </div>
  );
}
export default Timer;
